.container {
	position: absolute;
	top: 0px;
	bottom: 0px;
	width: 100%;

	.loginTop {
		width: 1030px;
		height: 116px;
		margin: 5px auto;
		margin-bottom: 0px;
	}

	.login_background {
		width: 100%;
		height: 510px;
		background: url(../assets/login.png) center no-repeat;
		background-size: auto 100%;

		.login_container {
			width: 1333px;
			margin: 0 auto;

			.lo {
				width: 500px;
				height: 350px;
				border: 1px solid #c6c6c6;
				border-top: 1px solid #c6c6c6;
				float: right;
				margin: 80px auto 0;
				background: #f5f5dc;

				.title {
					margin: 15px auto 40px auto;
					text-align: center;
					color: #505458;
					font-size: 22px;
					display: block;
				}

				.login_input {
					width: 380px;
					float: left;
				}

				.remember {
					float: left;
					font-size: 14px;
					line-height: 20px;
				}

				.forget {
					float: right;
					font-size: 14px;
					margin: 0 50px 0 0;
					line-height: 20px;
				}

				.login_button {
					width: 350px;
					cursor: pointer;
					font-size: 20px;
					margin: 0 80px 0 0;
				}
			}
		}
	}
}
